buf = ""

def shift_window(window, char):
    window.pop(0)
    window.append(char)


seq_length = 14
window = []
char_idx = 0
for char in buf:
    char_idx += 1
    # Load up until we have the first 4 characters
    if len(window) < seq_length:
        window.append(char)
        continue

    if len(window) == len(set(window)):
        break

    shift_window(window, char)

print(char_idx - 1)
